p.x:
var $bm_rt;
var offset_x, offset_y, x, y;
offset_x = effect('x')('ADBE Slider Control-0001');
offset_y = effect('y')('ADBE Slider Control-0001');
x = $bm_sum(transform.position[0], offset_x);
y = $bm_sum(transform.position[1], offset_y);
$bm_rt = [
    x,
    y
];

s.x:
